import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import TechnicianPage from './pages/TechnicianPage';
import DentistPage from './pages/DentistPage';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <Routes>
      <Route path="/" element={<LoginPage />} />
      <Route path="/technician" element={<ProtectedRoute role="technician"><TechnicianPage /></ProtectedRoute>} />
      <Route path="/dentist" element={<ProtectedRoute role="dentist"><DentistPage /></ProtectedRoute>} />
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
}

export default App;
